package yaksha.rest_ws.easy_kaprekar;

public class Kaprekar {
	private int serialNumber;
	private int kaprekarNumber;
	public Kaprekar(int serialNumber, int kaprekarNumber) {
		super();
		this.serialNumber = serialNumber;
		this.kaprekarNumber = kaprekarNumber;
	}
	public Kaprekar() {
		super();
		// TODO Auto-generated constructor stub
	}
	public int getSerialNumber() {
		return serialNumber;
	}
	public void setSerialNumber(int serialNumber) {
		this.serialNumber = serialNumber;
	}
	public int getKaprekarNumber() {
		return kaprekarNumber;
	}
	public void setKaprekarNumber(int kaprekarNumber) {
		this.kaprekarNumber = kaprekarNumber;
	}
	

}
